$('.share-holder').each(function(){
    $this = $(this);

    var url = (window.location != window.parent.location)
            ? document.referrer
            : document.location.href;

    $('.button.clip-copy').attr('data-clipboard-text', url);
    $('#shareInput').attr('value', url);

    $this.on('click', '.share.button', function(){
        $this.toggleClass('open');
        console.log("here");

        if (!$this.hasClass('open')){
            $('.button.clip-copy').text('Copy Link');
        }
    })


});

var clipboard = new ClipboardJS('.button.clip-copy');

clipboard.on('success', function(e) {
    e.trigger.innerHTML = 'Copied!'
    logEvent('Blog', 'Copy Share Link', $('div.center .hgroup h1').text());
    e.clearSelection();
});

clipboard.on('error', function(e) {
    console.error('Action:', e.action);
    console.error('Trigger:', e.trigger);
});


